  false,\n\t\"url\": null,\n\t\"notes\": \"Using a LH Systems ALS50 Light Detection
  And Ranging (LiDAR) system, flight lines of standard density (1.4 meter ground sample
  distance) data were collected over areas in Galveston County, TX (approximately
  400 square miles). Multiple returns were recorded for each laser pulse along with
  an intensity value for each return. The data acquisition occurred in missions during
  the fall of 2006. The data was collected by Sanborn Mapping Company, Inc. for the
  Texas Water Development Board (TWDB) and the Federal Emergency Management Agency
  (FEMA).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
